//LMS/lms_renca_frontend/src/components/profesor/AsignaturasDisponibles.js
import React, { useState, useEffect } from 'react';
import profesorService from '../../services/profesorService';
import './profesorCss/AsignaturasDisponibles.css'; // Archivo CSS para los estilos

const AsignaturasDisponibles = () => {
    const [asignaturas, setAsignaturas] = useState([]);

    useEffect(() => {
        profesorService.getAsignaturas().then((data) => {
            setAsignaturas(data);
        });
    }, []);

    return (
        <div className="asignaturas-disponibles">
            <h3>Asignaturas Disponibles</h3>
            <div className="asignaturas">
                {asignaturas.map((asignatura) => (
                    <div key={asignatura._id} className="asignatura">
                        <h4>{asignatura.nombre}</h4>
                        <p>{asignatura.descripcion}</p>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default AsignaturasDisponibles;
